import React from 'react'
import { Button } from 'antd'
import 'antd/dist/antd.css';

const Index = (props) => {
    return <Button onClick={props.onClick} disabled={props.disabled ? "disabled" : ""} type="primary" >{props.text}</Button>
}

export default Index;
